version = "21.9b0"
description = "The uncompromising code formatter."
category = "dev"
optional = false
python-versions = ">=3.6.2"

[package.dependencies]
click = ">=7.1.2"
mypy-extensions = ">=0.4.3"
pathspec = ">=0.9.0,<1"
platformdirs = ">=2"
regex = ">=2020.1.8"
tomli = ">=0.2.6,<2.0.0"
typing-extensions = [
    {version = ">=3.10.0.0", markers = "python_version < \"3.10\""},
    {version = "!=3.10.0.1", markers = "python_version >= \"3.10\""},
]

[package.extras]
colorama = ["colorama (>=0.4.3)"]
d = ["aiohttp (>=3.6.0)", "aiohttp-cors (>=0.4.0)"]
jupyter = ["ipython (>=7.8.0)", "tokenize-rt (>=3.2.0)"]
python2 = ["typed-ast (>=1.4.2)"]
uvloop = ["uvloop (>=0.15.2)"]

[[package]]
name = "boto3"
version = "1.17.53"
description = "The AWS SDK for Python"
category = "main"
optional = true
python-versions = ">= 2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*, !=3.5.*"

[package.dependencies]
botocore = ">=1.20.53,<1.21.0"
jmespath = ">=0.7.1,<1.0.0"
s3transfer = ">=0.3.0,<0.4.0"

[[package]]
name = "boto3-stubs"
version = "1.18.65"
description = "Type annotations for boto3 1.18.65, generated by mypy-boto3-builder 5.5.0"
category = "dev"
optional = false
python-versions = ">=3.6"

[package.dependencies]
botocore-stubs = "*"
mypy-boto3-batch = {version = ">=1.18.60", optional = true, markers = "extra == \"batch\""}
mypy-boto3-dynamodb = {version = ">=1.18.60", optional = true, markers = "extra == \"dynamodb\""}
mypy-boto3-events = {version = ">=1.18.60", optional = true, markers = "extra == \"events\""}
mypy-boto3-lambda = {version = ">=1.18.60", optional = true, markers = "extra == \"lambda\""}
mypy-boto3-s3 = {version = ">=1.18.60", optional = true, markers = "extra == \"s3\""}
mypy-boto3-s3control = {version = ">=1.18.60", optional = true, markers = "extra == \"s3control\""}
mypy-boto3-sns = {version = ">=1.18.60", optional = true, markers = "extra == \"sns\""}
mypy-boto3-sqs = {version = ">=1.18.60", optional = true, markers = "extra == \"sqs\""}
mypy-boto3-ssm = {version = ">=1.18.60", optional = true, markers = "extra == \"ssm\""}
mypy-boto3-stepfunctions = {version = ">=1.18.60", optional = true, markers = "extra == \"stepfunctions\""}
mypy-boto3-sts = {version = ">=1.18.60", optional = true, markers = "extra == \"sts\""}

